<script>
    import {mapActions, mapGetters} from 'vuex';

    export default {
        name: 'home',
        data() {
            return {
                skills: {},
                contact: {
                    name: '',
                    mail: '',
                    message:''
                }
            }
        },
        methods: {
            ...mapActions(['fetchSkills']),
            ...mapActions(['fetchIdentity']),
            ...mapActions(['fetchProjekts']),
            ...mapActions(['addContact']),
            subAddContact(contact) {
                if(this.contact.name.length < 5 || this.contact.name.length > 30 ||this.contact.mail.length < 5
                    || this.contact.mail.length > 30 || !this.contact.mail.includes('@')
                    || this.contact.message.length < 10 || this.contact.message.length > 300
                    || document.getElementById("mailTestTest").validity.valid === false) {
                    this.$buefy.toast.open({
                        message: "Vous n'avez pas réussi!"
                    });
                    return null
                }
                else {
                    this.addContact(contact);
                    this.contact.name = '';
                    this.contact.mail = '';
                    this.contact.message = '';
                    this.$buefy.toast.open({
                        message: 'Votre message a bien été envoyé!'
                    })
                }
            }
        },
        computed: {
            ...mapGetters(['allBackSkills']),
            ...mapGetters(['allFrontSkills']),
            ...mapGetters(['myIdentity']),
            ...mapGetters(['allProjekts'])
        },
        mounted() {
            this.fetchSkills();
            this.fetchIdentity();
            this.fetchProjekts()
        },
    }
</script>

